G.i. Joe Titulo original: G.I. JOE Ano: 2009 Genero: Accion Duracion: 0 Calidad de video: TS Screener MEDIA Peso: 505 mb Idioma: AUDIO LATINO Titulo: G.I. Joe Titulo original: G.I. Joe: Rise of Cobra Pais: USA Estreno en USA: 07/08/2009 Estreno en Espana: 07/08/2009 Productora: Paramount Pictures Director: Stephen Sommers Guion: Stuart Beattie Reparto: Adewale Akinnuoye-Agbaje, Christopher Eccleston, Joseph Gordon-Levitt, Sienna Miller, Rachel Nichols, Ray Park, Said Taghmaoui, Channing Tatum, Marlon Wayans, Dennis Quaid Genero: Accion, Aventuras Formato: Mp4 Sinopsis:G. I. Joe es el nombre en clave de una fuerza especial altamente entrenada cuya mision fundamental es defender la libertad humana y la paz mundial. Los valerosos Joes son hombres y mujeres de coraje, duenos de una mezcla dinamica de talentos especiales, personalidad e ingenuidad. Dotados de algunas de las armas mas sofisticadas que puedan concebirse, estos individuos constituyen la fuerza mas formidable de combate del mundo. Los G. I. Joes combaten a muchas sombrias organizaciones, pero estan siempre inmersos en una lucha constante con COBRA, su maligna nemesis que pretende dominar al mundo. Como G. I. Joe, COBRA ha reclutado a un grupo de hombres y mujeres increiblemente habiles y poderosos: sin embargo todos ellos ponen sus talentos al servicio de los designios malignos de COBRA. Siempre alertas, los Joes deben vigilar el mundo entero, ya que algunas veces las cosas no resultan ser lo que aparentan.
G I Joe 





